Relationship.create([subject_id: (Resource.find_by literal: 'T0010381').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "تستخدم في الوثائق المتعلقة بالاتحاد بين مصر وسوريا بين 1958 و1961, اما من للفترة ما بين 1961-1971 حيث استمرت مصر في استخدام الاسم \"الجمهورية العربية المتحدة\" فيستخدم اسم مصر لجميع الأعمال الصادرة عن مصر أو ذات العلاقة بمصر.", language_id: (Language.find_by name: 'ar').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0010381').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "用于1958-1961年间埃及和叙利亚联盟的有关资料；在1961－1971年间，虽然埃及继续使用阿拉伯联合共和国为其国名，但埃及出版的和有关埃及的资料均用“埃及”为叙词。", language_id: (Language.find_by name: 'zh').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0010381').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Use for documents relating to the Union of Egypt and Syria, between 1958 and 1961.  For the period 1961-1971, when Egypt continued to use the name \"United Arab Republic\", use EGYPT for works by or pertaining to Egypt", language_id: (Language.find_by name: 'en').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0010381').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "A utiliser pour les documents relatifs à l'union de l'Egypte et de la Syrie, entre 1958 et 1961. En ce qui concerne la période 1961-1971 (alors que l'Egypte continuait à utiliser le nom de \"République arabe unie\"), utiliser le terme \"EGYPTE\" pour des documents émanant de l'Egypte ou relatifs à l'Egypte", language_id: (Language.find_by name: 'fr').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0010381').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Использовать для документов, касающихся союза Египта и Сирии в 1958–1961 гг. Для документов периода 1961-1971 гг., касающихся Объединенной Арабской Республики составе одного только Египта использовать дескриптор «Египет»", language_id: (Language.find_by name: 'ru').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0010381').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Usese para los documentos relacionados a la Union de Egipto y Siria, entre 1958 y 1961. Para el período 1961-1971, cuando Egipto continuaba usando el nombre \"República Arabe Unida\", use EGIPTO para trabajos de o sobre Egipto.", language_id: (Language.find_by name: 'es').id).id])
